import React ,{BrowserRouter, Switch, Route, Redirect} from 'react';
import ReactDOM from 'react-dom';
import NavBar from './NavBar';
import Home from './Home';
import OurDestination from './OurDestination';
import OurPlans from './OurPlans';
import Contact from './Contact';

ReactDOM.render(
  <>
  <BrowserRouter>
  <Switch>
    <Route exact path='/' component={Home} />
    <Route exact path='/our destination' component={OurDestination} />
    <Route exact path='/our plans' component={OurPlans} />
    <Route exact path='/contact' component={Contact} />
    <Redirect to='/' />
  </Switch>
  </BrowserRouter>
  <NavBar />
  </>, document.getElementById('root')
)
